import React from 'react'
import {connect} from 'react-redux'
import {deleteTodo} from '../actions'

let DeleteTodo = ({id, dispatch}) => {
  return (
      <div>
        <button onClick={
          dispatch(deleteTodo(id))
        }> Delete TODO
        </button>
      </div>
  )
}

DeleteTodo = connect()(DeleteTodo)

export default DeleteTodo
